// NavBar.js
import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <div className="drawer-side">
      <label htmlFor="my-drawer" className="drawer-overlay"></label>
      <ul className="menu p-4 overflow-y-auto w-80 bg-base-300 text-base-content">
        {/* Sidebar content */}
        <li><NavLink to="/">Roster</NavLink></li>
        <li><NavLink to="/employeeform">Add Associate</NavLink></li>
        <li><NavLink to="/executivesummary">Executive Summary</NavLink></li>
        <li><NavLink to="/about">About</NavLink></li>
        <li><NavLink to="/associatetable">Associate Schedules</NavLink></li>
        <li><NavLink to="/schedulebuilder">Schedule Build Optimizer</NavLink></li>
        <li><NavLink to="/allocationsummary">Department Allocation Optimizer</NavLink></li>
      </ul>
    </div>
  );
}

export default NavBar;
